  [],\n\t\"revision_timestamp\": \"2015-09-26T22:23:58.708196\",\n\t\"name\": \"dissolved-inorganic-carbon-temperature-salinity-and-other-variables-collected-from-discrete-samd3949\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0113554 includes chemical,
  discrete sample, physical and profile data collected from HUDSON in the Davis Strait,
  Labrador Sea and North Atlantic Ocean from 1994-05-24 to 1994-06-12 and retrieved
  during cruise CARINA/18HU19940524. These data include CHLOROFLUOROCARBON-11 (CFC-11),
  CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12 (CFC-12), Carbon tetrachloride
  (CCL4), DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE,
  PHOSPHATE, Potential temperature (theta), SALINITY, SILICATE, WATER TEMPERATURE
  and methyl chloroform (MC). The instruments used to collect these data include CTD
  and bottle. These data were collected by E. Peter Jones of Bedford Institute of
  Oceanography and J. Lazier [affiliation unknown] as part of the CARINA/18HU19940524
  data set.nnThe CARINA (CARbon dioxide IN the Atlantic Ocean) data synthesis project
  is an international collaborative effort of the EU IP CARBOOCEAN, and U.S. partners.
  It has produced a merged internally consistent data set of open ocean subsurface
  measurements for biogeochemical investigations, in particular, studies involving
  the carbon system. The original focus area was the North Atlantic Ocean, but over
  time the geographic extent expanded and CARINA now includes data from the entire
  Atlantic, the Arctic Ocean, and the Southern Ocean.\",\n\t\"license_title\": null,\n\t\"extras\":
